import React from 'react';
import styled from "styled-components";
import Header from './components/Header';

const AppContainer = styled.div`
        display: flex;
        flex-direction: column;
        width: 100vw;
        height: 100vh;
        background: green;
`

class App extends React.Component {

  render () {   

    return (
      <AppContainer>
        <Header />
        <div>Pages</div>
        </AppContainer>
    );


  }

}

export default App;
